import React from 'react';

// PersonalInfo Component
const PersonalInfo = (props) => {
  return (
    <div>
      <h1>Personal Info</h1>
      <p> {props.name}</p>
      <p>Age: {props.age}</p>
      <p>Email: {props.email}</p>
    </div>
  );
};

// App Component
function App() {
  // Define personalInfo object
  const personalInfo = {
    name: "Matimba",
    age: 24,
    email: "matimba@gmail.com"
  };

  return (
    <div>
      <PersonalInfo 
        name={personalInfo.name} 
        age={personalInfo.age} 
        email={personalInfo.email} 
      />
    </div>
  );
}

export default App;
